VALUES ('8606017371533', 'MIX sir, origano, kečap', 'Flips sa ukusom kečapa i zaslađivačem [kukuruzni griz, palmino ulje, aroma kečapa 8.9% (šećer, so, crni luk u prahu, maltodekstrin, pojačivači arome-mononatrijum glutaminat i dinatrijum-5\'-ribonukleotid, paradajz u prahu 5.2%, _hidrolizovani biljni proteini_, beli luk u prahu, regulator kiselosti - natrijum diacetat, boja - paprika ekstrakt, kapsantin, kapsorubin, đumbir u prahu, kukuruzni skrob, kiselina - limunska kiselina, zaslađivač - sukraloza 0.02%)] Flips sa ukusom sira [kukuruzni griz, palmino ulje, aroma sira 8.7% (_surutka u prahu_, so, pojačivači arome - mononatrijum glutaminat i dinatrijum-5\'-ribonukleotid, palmino ulje, _aromatični preparati_, kukuruzni maltodekstrin, zgušnjivač - skrob- natrijum-oktenilsukcinat stabilizator, _sir u prahu_ &lt;1%, _natrijum kazeinat_, ulje kanole, emulgator - trigliceridi srednjeg lanca (od masnih kiselina kokosovog ulja), prirodne i prirodno identične aromatične supstance, boja - paprika ekstrakt, kapsantin, kapsorubin)] Proizvod na bazi peleta sa ukusom origana [Pelet (kukuruzni griz, šećer, so, palmino ulje, sredstvo za dizanje testa - natrijum hidrogenkarbonat, emulgator - mono i digliceridi masnih kiselina), palmino ulje, aroma origana 7% (so, _prirodni aromatični preparati_, _surutka_ u prahu, _prezle_, dekstroza, crni luk u prahu 12%, pojačivači arome - mononatrijum glutaminat, ulje palminih koštica, peršun 6%, beli luk u prahu 1%, kiselina - limunska kiselina, ulje origana 0.1%)]', 'https://static.openfoodfacts.org/images/products/860/601/737/1533/front_sr.8.400.jpg', '32.8', '15.2', '53.2', '3.2', '2.4', '5.7', '2.1', '0.826771653543307', '', '0');

